oxy_webhelp_navlinks = {"azr_recover_vm_md-d23139e17726":{"topics":[{"title":"Recovering files or folders to an Azure storage account","shortdesc":"<p class=\"shortdesc\">Recover files or folders from Azure virtual machines or managed disks to an Azure         storage account if the files that you want to access are deleted, corrupted, or         encrypted.<\/p>","href":"saas\/recovering_files_folders_to_azr_storage_account.html","attributes":{"data-id":"recovering_files_folders_to_azr_storage_account"},"menu":{"hasChildren":false},"tocID":"recovering_files_folders_to_azr_storage_account-d23139e17737","topics":[]},{"title":"Cross-region export of ADE virtual machines","shortdesc":"<p class=\"shortdesc\">Cross-region export of Azure Disk Encryption-enabled virtual machines involves         securely migrating encryption keys and secrets to a new key vault in the target Azure         region.<\/p>","href":"saas\/azr_cross_region_export_ade_vm.html","attributes":{"data-id":"azr_cross_region_export_ade_vm"},"menu":{"hasChildren":false},"tocID":"azr_cross_region_export_ade_vm-d23139e17748","next":"azr_cross_region_export_ade_vm-d23139e17748"},{"title":"Exporting Azure virtual machine snapshots","shortdesc":"<p class=\"shortdesc\">Export a snapshot of an Azure virtual machine to create a virtual machine from a         point-in-time copy of the source virtual machine.<\/p>","href":"saas\/azr_exporting_vm_snapshot.html","attributes":{"data-id":"azr_exporting_vm_snapshot"},"menu":{"hasChildren":false},"tocID":"azr_exporting_vm_snapshot-d23139e17814","topics":[]},{"title":"Exporting an Azure managed disk snapshot","shortdesc":"<p class=\"shortdesc\">Export a snapshot of an Azure managed disk to create a new disk from a point-in-time         copy of the source managed disk.<\/p>","href":"saas\/export_azure_md_snapshot.html","attributes":{"data-id":"export_azure_md_snapshot"},"menu":{"hasChildren":false},"tocID":"export_azure_md_snapshot-d23139e17825","topics":[]},{"title":"Exporting relic snapshots","shortdesc":"<p class=\"shortdesc\">Export a snapshot of a relic Azure virtual machine.<\/p>","href":"saas\/azr_exporting_relic_snapshots.html","attributes":{"data-id":"azr_exporting_relic_snapshots"},"menu":{"hasChildren":false},"tocID":"azr_exporting_relic_snapshots-d23139e17836","topics":[]},{"title":"Restoring Azure virtual machine using a snapshot","shortdesc":"<p class=\"shortdesc\">Use an Azure virtual machine snapshot to replace the original virtual machine with a         fully functional point-in-time copy.<\/p>","href":"saas\/azr_restore_snapshot.html","attributes":{"data-id":"azr_restore_snapshot"},"menu":{"hasChildren":false},"tocID":"azr_restore_snapshot-d23139e17847","topics":[]},{"title":"Mounting Azure virtual disks for data recovery","shortdesc":"<p class=\"shortdesc\">To recover critical data in a disaster or outage that can pose a significant business         problem, mount the Azure virtual disks to the source virtual machine or a different virtual         machine running in another region or subscription.<\/p>","href":"saas\/mounting_azr_virtual_disks_for_data_recovery.html","attributes":{"data-id":"mounting_azr_virtual_disks_for_data_recovery"},"menu":{"hasChildren":false},"tocID":"mounting_azr_virtual_disks_for_data_recovery-d23139e17858","topics":[]},{"title":"Viewing Live Mounts page for Azure virtual machines","shortdesc":"<p class=\"shortdesc\">To review detailed information about the target virtual machines in Azure, such as         the number of mounted virtual disks, the time when the disks were mounted, and the status of         the mount task, open the Live Mounts page for Azure virtual machines. Additionally, you can         unmount a disk from the target virtual machine.<\/p>","href":"saas\/viewing_live_mounts_page_for_azr_vm.html","attributes":{"data-id":"viewing_live_mounts_page_for_azr_vm"},"menu":{"hasChildren":false},"tocID":"viewing_live_mounts_page_for_azr_vm-d23139e17869","topics":[]},{"title":"Unmounting an Azure virtual disk from Azure virtual machine","shortdesc":"<p class=\"shortdesc\">When you no longer need an Azure virtual disk attached to an Azure virtual machine,         from the Live Mounts page, unmount the corresponding virtual disk to free up storage         space.<\/p>","href":"saas\/unmounting_azr_virtual_disk_from_azr_vm.html","attributes":{"data-id":"unmounting_azr_virtual_disk_from_azr_vm"},"menu":{"hasChildren":false},"tocID":"unmounting_azr_virtual_disk_from_azr_vm-d23139e17880","topics":[]},{"title":"Azure In-place File Recovery","shortdesc":"<p class=\"shortdesc\">With the In-place File Recovery feature, you can recover Azure files from an indexed         snapshot either to a source virtual machine or a different virtual machine or export the         files to a different virtual machine.<\/p>","href":"saas\/azr_in_place_file_recovery.html","attributes":{"data-id":"azr_in_place_file_recovery"},"menu":{"hasChildren":false},"tocID":"azr_in_place_file_recovery-d23139e17891","next":"azr_in_place_file_recovery-d23139e17891"}]}};